// https://leetcode.com/problems/longest-substring-without-repeating-characters/description/

use std::collections::HashSet;

use stdext::recipe::Log;

fn no_dup(s: &str) -> bool {
    s.chars().collect::<HashSet<_>>().len() == s.len()
}

pub fn answer(s: String) -> i32 {
    let mut longest = 0;
    for i in 0..s.len() {
        for j in 0..s.len() - i {
            let substr = &s[i..i + j + 1];
            if no_dup(substr) && substr.len() > longest {
                longest = substr.len();
            }
        }
    }
    longest as i32
}

